export class SessionExpiredError extends Error {
  constructor(message) {
    super(message);
    this.name = "SessionExpiredError";
  }
}

export class CaptchaError extends Error {
  constructor(message) {
    super(message);
    this.name = "CaptchaError";
  }
}

export class LoginError extends Error {
  constructor(message) {
    super(message);
    this.name = "LoginError";
  }
}

export const clearAllExceptOne = async (keyToPreserve) => {
  const allKeys = await AsyncStorage.getAllKeys();
  const keysToRemove = allKeys.filter(key => key !== keyToPreserve);
  await AsyncStorage.multiRemove(keysToRemove);
};

export function compareArrayWithJson(notList, currentMarks) {
  const differingObjects = [];
  for (const obj1 of notList) {
    const obj2 = currentMarks.find(o => o.dersAdi === obj1.dersAdi);
    if (obj2) {
      let hasDifference = false;
      let differingKeysAndObjs = [];
      for (const key in obj1) {
        if(key === 'sinavlar') {
          for (const examObject of obj1[key]) {
            const examObject2 = obj2[key].find(o => o.sinavAdi === examObject.sinavAdi); // Find the exam object with the same name
            if (examObject2) {
              for (const key2 in examObject) {
                if (examObject.hasOwnProperty(key2) && examObject[key2] !== examObject2[key2]) {
                  hasDifference = true;
                  differingKeysAndObjs.push(examObject);
                }
              }
            }
            else {
              hasDifference = true;
              differingKeysAndObjs.push(examObject);
            }
          }
        }
        else if (obj1.hasOwnProperty(key) && obj1[key] !== obj2[key]) {
          hasDifference = true;
          differingKeysAndObjs.push(key); 
        }
      }
      if (hasDifference) {
        differingObjects.push({
          ...obj1,
          differingKeysAndObjs
        });
      }
    }
  }
  return differingObjects;
}

export async function notNotification(ders) {
  const t = (key) => i18n.t(`Notifications.${key}`);
  const currentLanguage = i18n.locale;
  const notificationContentArray = [];
  const {dersAdi, ort, harfNotu, differingKeysAndObjs} = ders;
  const examObjects = differingKeysAndObjs.filter(item => typeof item === 'object');
  if(examObjects.length!==0) { // if there is an exam object it means that there was a change in the marks
    examObjects.forEach(examObject => {
      const {sinavAdi, sinavNotu} = examObject;
      if(sinavNotu === '--')
        notificationContentArray.push({
          title: `${dersAdi}`,
          body: currentLanguage === 'en' ?
          `The teacher has opened the ${sinavAdi.toLowerCase()} mark field.` : 
          `Hoca ${sinavAdi.toLowerCase()} notu alanƒ±nƒ± a√ßmƒ±≈ütƒ±r.`,
        })
      else if(differingKeysAndObjs.includes('harfNotu')) // Mark is out and lesson is finalized
        notificationContentArray.push({
          title: `${dersAdi} ${sinavAdi.toLowerCase()} ${t('announced')}`,
          body: currentLanguage === 'en' ?
          `You got ${sinavNotu} and the lesson has been finalized as ${harfNotu} ${emoji(harfNotu)}` :
          `${sinavNotu} aldƒ±nƒ±z ve ders ${harfNotu} olarak sonu√ßlandƒ±rƒ±ldƒ± ${emoji(harfNotu)}`,
        })
      else
        notificationContentArray.push({ // Mark is out but lesson is not finalized
          title: `${dersAdi} ${sinavAdi.toLowerCase()} ${t('announced')}`,
          body: currentLanguage === 'en' ?
          `You got ${sinavNotu} ${emoji(Number(sinavNotu))}` :
          `${sinavNotu} aldƒ±nƒ±z ${emoji(Number(sinavNotu))}`,
        })
    })
  }
  else { // Lesson finalized without change in exam marks
    notificationContentArray.push({
      title: `${dersAdi} ${t('finalized')}`,
      body: currentLanguage === 'en' ?
      `Your average is ${ort} and the lesson has been finalized as ${harfNotu} ${emoji(harfNotu)}` :
      `Ortalamanƒ±z ${ort} ve ders ${harfNotu} olarak sonu√ßlandƒ±rƒ±ldƒ± ${emoji(harfNotu)}`,
    })
  }
  return notificationContentArray;
}

function emoji(markOrHarfNotu) {
  return typeof markOrHarfNotu === 'number'
    ? markOrHarfNotu >= 90 ? 'ü•≥'
    : markOrHarfNotu >= 80 ? 'üòÑ'
    : markOrHarfNotu >= 70 ? 'üôÇ'
    : markOrHarfNotu >= 60 ? 'üòê'
    : markOrHarfNotu >= 50 ? 'üòû'
    : 'ü§ï'
    : markOrHarfNotu === 'AA' ? 'ü•≥'
    : markOrHarfNotu === 'BA' ? 'üòÑ'
    : markOrHarfNotu === 'BB' ? 'üôÇ'
    : markOrHarfNotu === 'CB' ? 'üòê'
    : markOrHarfNotu === 'CC' ? 'üòû'
    : 'ü§ï';
}

export async function solveCaptcha(token, captchaBase64) {
  try {
    const formData = new FormData();
    formData.append('captchaImage', captchaBase64); // Append the decoded base64 data directly to the FormData
    const result = await axios.post(API_URL, {captchaBase64}, {
      headers: {
        'Authorization': `Bearer ${token}`,
      },
    });
    return result.data;
  } catch (error) {
    throw error
  }
}

